svg:
 onmousemove="movetip(evt)" onmouseup="endmove()">


var dragtipid = null; var dragcase = false; function init(evt){
if (window.svgDocument==null) svgDocument = evt.target.ownerDocument;
}
function movetip(evt){if (dragtipid!=null){ dragcase = true;
var tip=svgDocument.getElementById(dragtipid);
tip.setAttributeNS(null,"x",evt.clientX-2);
tip.setAttributeNS(null,"y",evt.clientY-2);
}}
function endmove(){dragtipid = null;}
function startmove(evt,id){dragtipid = id; dragcase = false;
var tip=svgDocument.getElementById(dragtipid);
tip.setAttributeNS(null,"x",evt.clientX-2);
tip.setAttributeNS(null,"y",evt.clientY-2);
}
function Showtip(evt,id){ dragtipid = null;
var tip=svgDocument.getElementById(id);
var vis=tip.getAttributeNS(null,"visibility");
if (vis=="hidden"){
tip.setAttributeNS(null,"x",evt.clientX-2);
tip.setAttributeNS(null,"y",evt.clientY-2);
tip.setAttributeNS(null,"visibility","visible");
}}
function Hidetip(id){ dragtipid = null; if (dragcase==false){
var tip=svgDocument.getElementById(id);
tip.setAttributeNS(null,"visibility","hidden");
}}







